        /* Toggle Styles */
        #wrapper {
            padding-left: 0;
            -webkit-transition: all 0.5s ease;
            transition: all 0.5s ease;
        }
        #wrapper #wrapper.toggled {
            padding-left: 250px;
        }
        #sidebar-wrapper {
            z-index: 1000;
            position: fixed;
            left: 250px;
            width: 0;
            height: 100%;
            margin-left: -250px;
            overflow-y: auto;
            background: #4d5e70;
            -webkit-transition: all 0.5s ease;
            transition: all 0.5s ease;
        }
        #wrapper.toggled #sidebar-wrapper {
            width: 250px;
        }
        #page-content-wrapper {
            width: 100%;
            position: absolute;
        }
        #page-content-wrapper .container-fluid .row {
            margin: 15px;
        }
        #wrapper.toggled #page-content-wrapper {
            position: absolute;
            margin-right: -250px;
        }
        @media (max-width: 768px) {
            #page-content-wrapper {
                padding-left: 0;
                -webkit-transition: all 0.5s ease;
                transition: all 0.5s ease;
            }
            #wrapper.toggled #page-content-wrapper {
                -webkit-transition: all 0.5s ease;
                transition: all 0.5s ease;
                padding-left: 250px;
                margin-right: -250px;
            }
        }
        @media (min-width: 768px) {
            #wrapper {
                padding-left: 250px;
            }
            #wrapper.toggled {
                padding-left: 0;
            }
            #sidebar-wrapper {
                width: 250px;
            }
            #wrapper.toggled #sidebar-wrapper {
                width: 0;
            }
            #page-content-wrapper {
                position: relative;
            }
            #wrapper.toggled #page-content-wrapper {
                position: relative;
                margin-right: 0;
